import logo from './logo.svg';
import './App.css';
import {InputComponents} from './inputComponents';

function App() {

  const [json, setJson] = useState(1);

  useEffect(() => {
    fetch('/map')
  .then(res =>
    res.json()).then(data => {
    console.log(data);
    setJson(data.map_new);
  });
}, []);

// console.log(data);
console.log(json);
  return (
    <div className="App">
        <p>
          {json}
        </p>
        <InputComponents />
    </div>

  );
}

export default App;
